    const [data, setData] = useState({})
    const { course_id } = useParams()
    axios.get('http://localhost:5000/course/' + course_id)
        .then(res => {
            console.log(res.data)
            setData(res.data)
        })
        .catch(err => {
            console.log(err)
        })

    return (
        <div className="course">
            <h1>Course</h1>


        </div>
    )



}
